angular.module('DMApp.services', [])
    .factory('layoutModel', ['$http', function($http) {
        var data = {},
            model = {};

        model.addTemplate = function(template) {
            data[template.id] = template.data;
        };

        model.removeTemplate = function(id) {
            delete data[id];
        };

        model.findById = function(id) {
            return data[id];
        };

        model.save = function() {
            return $http({
                url: ajaxurl,
                method: "POST",
                params: {
                    action: 'sf_api',
                    method: 'component.model.save'
                },
                data: JSON.stringify({ params: { models: data } }).replace(new RegExp('../../../../..', 'g'), '---gddyworkaround---')
            })
        };

        return model;

    }])
    .service('templateModel', [function() {
        function Template(id, data) {
            this.id = id;
            this.data = data;
        }

        this.create = function(id, data) {
            return new Template(id, data);
        };
    }])
